$_MODULE['<{appagebuilder}prestashop>guide_a27ed6a695aa474957c9a650f9b86904'] = 'Se pueden crear varios perfiles, sólo un perfil, el valor predeterminado se activa cuando la página web se publica. Cada perfil se puede personalizar la interfaz para cambiar independientemente el uno del otro sitio web, JavaScript y CSS para editar directamente aquí debería ser más flexible.';
