$_MODULE['<{appagebuilder}prestashop>guide_1339273fae8c281aebfa708f299d4854'] = 'Este módulo también la oferta de muchos widgets para construir funciones de ventas, intuitiva interfaz de usuario la flexibilidad. integrar también sus módulos existentes en este módulo, sólo se necesita para construir un sitio construido justo aquí y convertido en la página más rápido.';
